import './App.css';
import { Component } from 'react';

class App extends Component {
  constructor(props){
    super(props);
    this.state = {
      gridArray:[ [ "1", "2"], [ "3", "4" ] ],
    }
  }

  render(){
    return (

      <div className="App">
        <header className="App-header">
        </header>

        <body>
            <div className="GridDiv">
              { this.state.gridArray.map(Element => Element.map(Element2 => <h1>{Element2}</h1> )) }
              this is more text
            </div>

        </body>
      </div>
    );
  }

}

export default App;
